import React, { useState, useEffect } from 'react';

const ColorAnalysis = () => {
  const [analysisResults, setAnalysisResults] = useState([]);

  useEffect(() => {
    const intervalId = setInterval(() => {
      const storedResults = localStorage.getItem('analysisResults');
      if (storedResults) {
        setAnalysisResults(JSON.parse(storedResults));
      }
    }, 1000);

    // Clear interval on component unmount
    return () => clearInterval(intervalId);
  }, []);

  return (
    <div style={{ marginLeft: '20px' }}>
  <h3>Analysis Results:</h3>
  {analysisResults.length === 0 ? (
    <p>No analysis results found.</p>
  ) : (
    <div>
      <h3>Your seasonal color is: {analysisResults[0]}</h3>
      <p> To learn more about this, check out [insert link]</p>
      <br />
      <h3 > Colors You Should Wear:</h3>
      <div>
        {analysisResults[1].slice(1, -1).split(', ').map((color, index) => (
          <button
            key={index}
            style={{ backgroundColor: color, width: '130px', height: '130px', margin: '5px', border: 'none', cursor: 'default' }}
            disabled
          >
            {color}
          </button>
        ))}
      </div>
      <br />
      <h3> Colors You Should Avoid:</h3>
      <div>
        {analysisResults[2].slice(1, -1).split(', ').map((color, index) => (
          <button
            key={index}
            style={{ backgroundColor: color, width: '130px', height: '130px', margin: '5px', border: 'none', cursor: 'default' }}
            disabled
          >
            {color}
          </button>
        ))}
      </div>
    </div>
  )}
</div>

  );
};

export default ColorAnalysis;
